import React from 'react';
import { Box, TextField } from '@material-ui/core';

const signUp = () => {
    return (
        <div>
            <h1>Registration Form</h1>
            <Box
                component="form"
                sx={{
                    '& > :not(style)': { m: 1, width: '25ch' }
                }}
                noValidate
                autoComplete="off"
            >
                <TextField sx={{ display:'block' }} type="text" className="outlined-basic" label="Name" variant="outlined" />
                <TextField sx={{ display:'block' }} type="text" className="outlined-basic" label="Email" variant="outlined" />
                <TextField sx={{ display:'block' }} type="password" className="outlined-basic" label="Password" variant="outlined" />
            </Box>
        </div>
    )
}

export default signUp;
